import { combineReducers } from "redux";
import { carouselReducer } from "./carouselReducer";
import { layDanhSachPhimReducer } from "./phimReducer";

export const rootReducer = combineReducers({
  carouselReducer,
  a: layDanhSachPhimReducer,
});
